import logo from '../../resources/whats.png';
import './WhatsappButton.css'

export default function WhatsappButton(){
    return(
    <div className="whatsapp">
        <img src={LOGO} width="50" alt="Icone do whatsapp" title="Fale conosco pelo WhatsApp"/>
    </div>   
    );
};
